import React, { useState, useEffect } from 'react'
import { json, useLocation, useNavigate } from "react-router-dom"
import Navbar from "./Navbar";
import NavbarAccount from "./NavbarAccount"
import Validation from './LoginValidation'
import "./assets/css/main.css";
import Axios from 'axios'


const LoginPage = () => {
	const [values, setValues] = useState({
		email: '',
		password: '',
	})

	let session = '';
	localStorage.getItem('session', JSON.stringify(session))

	const [errors, setErrors] = useState({})

    const navigate = useNavigate();
    const path = useLocation();

	const handleInput = (event) => {
		setValues(prev => ({...prev, [event.target.name]: [event.target.value]}))
	}

	const handleSubmit = (event) => {
		event.preventDefault();
		setErrors(Validation(values));
		if(errors.email === "" && errors.password === "") {
			localStorage.setItem('session', JSON.stringify(values))
			Axios.post("http://localhost:8081/login", values)
			.then(res => {
			 	if(res.data.Login) {
			 		navigate('/')
			 	} else {
			 		console.log(values);
			 	}
			})
			.catch(err => console.log(err));
		}
	}

    let ses = session;
    let nav = '';

    if (ses === '[{"email":"Empty","password":"Empty"}]') {
	   nav = <NavbarAccount />
	} else {
	   nav = <Navbar />
    }

  	return (
    <div id="page-wrapper">

    <Navbar />

    <div id="footer" style={{ background: "white" }}>
		<div className="container" style={{ background: "white", marginBottom: "-5%" }}>
			<div className="auth">
				<section className="6c 12u(narrower) 12u$(mobilep)">
					<h3>Авторизація</h3>
						<form>
							<div className="row 100%">
								<div className="12u 12u(mobilep)">
									<input type="email" name="email" id="email" placeholder="Ваша електронна пошта" onChange={handleInput}/>
								</div>
								<div className='mrg'>
									{errors.email && <span className="err">{errors.email}</span>}
								</div>
							</div>
							<div className="row 50%">
								<div className="12u 12u(mobilep)">
									<input type="password" name="password" id="name" placeholder="Пароль" onChange={handleInput}/>
								</div>
								<div className='mrg'>
									{errors.password && <span className="err">{errors.password}</span>}
								</div>
							</div>
							<div className="row 50%">
								<div className="12u">
									<ul className="actions" style={{ marginBottom: "20px" }} onClick={handleSubmit}>
										<li><input type="submit" className="button alt" value="Увійти"/></li>
									</ul>
								</div>
							</div>
						</form>
					<br></br>
				</section>

				<div style={{ display: "flex", height: "30px" }}>
				<p>Забули пароль?</p><a href="#" style={{ marginLeft: "2%" }}><b>Нагадати</b></a>
			</div>
		</div>
	</div>

	<br></br>
	<br></br>
	<br></br>
		<br></br>
			<div className="copyright">
				<ul className="menu">
					<li>&copy; JavaScript. All rights reserved</li><li>Design: <a href="http://">Tockyj Bohdan</a></li>
				</ul>
        	</div>
		</div>
    </div>
	);
};

export default LoginPage
